import React from "react";
import styled from "styled-components";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

const Wrapper = styled.div`
  min-height: 50vh;
`;

function Contact() {
  return (
    <>
      <Navbar />
      <Wrapper>
        <h3>Contact Page</h3>
      </Wrapper>
      <Footer />
    </>
  );
}

export default Contact;
